import React from "react";
import { Card, Button } from "react-bootstrap";
import "./ResearchProject.css"; // CSS dosyasını import ediyoruz

const ResearchProject = ({ projects }) => {
  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Research Projects</h2>
      <div className="row">
        {projects.map((project, index) => (
          <div key={index} className="col-md-4">
            <Card className="mb-4 h-100">
              <Card.Body>
                <div className="project-header">
                  <Card.Subtitle className="text-muted">
                    {project.yearRange}
                  </Card.Subtitle>
                  <Card.Title>{project.title}</Card.Title>
                </div>
                <Card.Text>{project.description}</Card.Text>
                <Card.Text>
                  <strong>Funding Source:</strong> {project.fundingSource}
                </Card.Text>
                <Card.Text>
                  <strong>Team:</strong> {project.team}
                </Card.Text>
                <Button
                  variant="primary"
                  href={project.summaryLink}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Proje Özeti
                </Button>
              </Card.Body>
            </Card>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ResearchProject;
